import { Container, Nav, Navbar, NavDropdown } from "react-bootstrap";

export const Header = () => {
  const genres = [
    {
      id: 20,
      name: "Thriller",
    },
    {
      id: 18,
      name: "Science fiction",
    },
    {
      id: 1,
      name: "Action",
    },
    {
      id: 19,
      name: "Horror",
    },
    {
      id: 21,
      name: "Survival",
    },
    {
      id: 17,
      name: "Fantasy",
    },
    {
      id: 22,
      name: "Historical",
    },
    {
      id: 23,
      name: "Stealth",
    },
    {
      id: 27,
      name: "Comedy",
    },
    {
      id: 28,
      name: "Business",
    },
    {
      id: 31,
      name: "Drama",
    },
    {
      id: 32,
      name: "Non-fiction",
    },
    {
      id: 35,
      name: "Kids",
    },
    {
      id: 33,
      name: "Sandbox",
    },
    {
      id: 38,
      name: "Open world",
    },
    {
      id: 39,
      name: "Warfare",
    },
    {
      id: 41,
      name: "4X (explore, expand, exploit, and exterminate)",
    },
    {
      id: 34,
      name: "Educational",
    },
    {
      id: 43,
      name: "Mystery",
    },
    {
      id: 40,
      name: "Party",
    },
  ];

  return (
    <Navbar
      collapseOnSelect
      expand="lg"
      bg="dark"
      variant="dark"
      className="mb-3"
    >
      <Container>
        <Navbar.Brand href="/">PlayList</Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#features">Recommended Games</Nav.Link>
            <Nav.Link href="/top100">Top 100</Nav.Link>
            <Nav.Link href="/upcoming">Upcoming Games</Nav.Link>
            <NavDropdown
              title="Genres"
              id="collasible-nav-dropdown"
              menuVariant="dark"
            >
              {genres.map((item) => (
                <NavDropdown.Item href="#action/3.1">
                  {item.name}
                </NavDropdown.Item>
              ))}
            </NavDropdown>
          </Nav>
          <Nav>
            <Nav.Link>Find your all favorite games in one place!</Nav.Link>
          </Nav>
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
};
